import React from 'react';

const IssueCard = ({ issue }) => {
  return (
    <div className="issue-card">
      <h3>{issue.IssueName}</h3>
      <p>Type: {issue.IssueType != ""? issue.IssueType : "No type specified add edit option" }</p>
    </div>
  );
};

export default IssueCard;
